css:
@-moz-document domain(sketchfab.com) {

@-webkit-keyframes radioactivePulse {
  from { text-shadow: 0 0 9px #f00; }
  50% { text-shadow: 0 0 95px #f11; }
  to {  text-shadow: 0 0 9px #f22; }
}

.model-name .private {
  font-size:120px;
  color:#f00;

  -webkit-animation-name: radioactivePulse;
  -webkit-animation-duration: 2s;
  -webkit-animation-iteration-count: infinite;
}


}
